import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
//import {BrowserRouter as Router, Route, Switch, Link, Redirect} from 'react-router-dom';
// import Card from 'react-bootstrap/Card';
// import ListGroup from 'react-bootstrap/ListGroup';
// import ListGroupItem from 'react-bootstrap/ListGroup';
// import Navbar from 'react-bootstrap/Navbar';
import {Button, Breadcrumb, Card, Container, Row, Col, ButtonGroup} from 'react-bootstrap';

//Pages
//import MainPage from './pages';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container>
          <Row>
            <Col>
              <div className="navbar">
                <ul>
                  <li>Home</li>
                  <li>My Patients</li>
                  <li>Notifications</li>
                  <li>Upload Content</li>
                  <li>My Content</li>
                  <li>My Profile</li>
                </ul>
              </div>
            </Col>
          </Row>
          <Row>
            <Col className="mb-5">
              <Card className="ProfileCard">
                <img id="profilepic" src="https://fertilitynetworkuk.org/wp-content/uploads/2017/01/Facebook-no-profile-picture-icon-620x389.jpg" alt="No display" />
                <p>Basic text description in here.</p>
                <p>Location: SF, CA</p>
                <p>Age: 15</p>
                <p>*Another Field*</p>
              </Card>
            </Col>
            <Col>
            \n\n
            </Col>
            <Col>
              <>
                <ButtonGroup size="lg" className="mb-2">
                  <Button>Assign</Button>
                  <Button>User Content</Button>
                  <Button>Progress Report</Button>
                  <Button>Contact</Button>
                </ButtonGroup>
              </>
              <Card className="AboutMe">
                <div className="AboutMeDiv">
                  This is the about me section.
                </div>
              </Card>
            </Col>
          </Row>
        </Container>
      </header>
    </div>
  );
}


export default App;



